import './App.css';
import NavBar from './components/NavBar';
import cards from './components/TestimonialSlider';
import Slider from "react-slick"
import testimonials from './components/Testimonials';

function App() {
  return (
    <div>
      <NavBar />
      <div>
        <h1>Testimonials</h1>
        <Slider>{testimonials.map(cards)}</Slider>
      </div>
    </div>
  );
}

export default App;
